import React from 'react';
import {basketBall,asphaltBall,footyBall,volleyBall,grassBall} from "./img/export";
import './App.css';
import Card from "./card";
import Navigation from "./navigation";
import Logo from "./logo";
import Particles from 'react-particles-js';

const particlesOptions = {
      particles: {
            number: {
                  value: 30,
                  density: {
                        enable: true,
                        value_area: 800
                  }
            }
      }
}
function App() {
  return (
    <div className="App">
          <Particles className="particles" params={particlesOptions}/>
        <Navigation/>
        <Logo/>
        <div className="zone">
        <Card ballType={basketBall} sport={"basketball"}/>
        </div>
        <div className="zone">
        <Card ballType={asphaltBall} sport={"futsal ball"}/>
        </div>
        <div className="zone">
        <Card ballType={footyBall} sport={"footyvolley ball"}/>
        </div>
        <div className="zone">
        <Card ballType={volleyBall} sport={"volleyBall"}/>
        </div>
        <div className="zone">
        <Card ballType={grassBall} sport={"soccer ball"}/>
        </div>
        <p>
          Edit <code>src/App.js</code> and save to reload.
        </p>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>

    </div>
  );
}

export default App;
